using UnityEngine;
using System.Runtime.InteropServices;
using System;

public class Control : MonoBehaviour
{
    private string sound = "";

    private AudioSource audioSource;

    private static int sampleDataLength = 512;
    private float[] clipSampleData = new float[sampleDataLength];

    void Start()
    {
        audioSource = GetComponent<AudioSource>();
        if (audioSource == null)
        {
            audioSource = gameObject.AddComponent<AudioSource>();
        }
    }

    // Update is called once per frame
    void Update()
    {
        if (Input.GetKeyDown(KeyCode.Space))
        {
            speak(sound);
        }
    }

    public void speak(string b64data)
    {
        byte[] audioData = Convert.FromBase64String(b64data);

        int sampleRate = 44100;
        int channels = 1; // Mono
        int bitsPerSample = 16;

        // 2. Create an AudioClip from the raw data
        float[] samples = ConvertBytesToFloat(audioData, bitsPerSample);
        AudioClip audioClip = AudioClip.Create("WAVClip", samples.Length, channels, sampleRate, false);
        audioClip.SetData(samples, 0);        

        audioSource.clip = audioClip;
        audioSource.volume = 1.0f;  // Ensure the volume is up
        audioSource.loop = false;
        audioSource.Play();
        Debug.Log("Playing AudioClip");
    }

    private float[] ConvertBytesToFloat(byte[] data, int bitsPerSample)
    {
        int bytesPerSample = bitsPerSample / 8;
        int sampleCount = data.Length / bytesPerSample;
        float[] samples = new float[sampleCount];

        for (int i = 0; i < sampleCount; i++)
        {
            float sample = 0;
            if (bytesPerSample == 2)
            {
                sample = (short)(data[i * 2] | (data[i * 2 + 1] << 8)) / 32768f;
            }
            else if (bytesPerSample == 1)
            {
                sample = (sbyte)data[i] / 128f;
            }
            samples[i] = sample;
        }
        return samples;
    }


    private AudioClip ToAudioClip(byte[] wavData)
    {
        // Assuming a standard PCM WAV format
        int headerSize = 44; // Standard size, might need adjustment

        // Check if the data is at least the size of a basic header
        if (wavData.Length <= headerSize)
        {
            Debug.LogError("WAV data is too short to contain a header.");
            return null;
        }

        // Extract audio data (assuming 16-bit mono for now - adjust based on your WAV)
        int dataSize = wavData.Length - headerSize;
        if (dataSize % 2 != 0) // Check if the audio data size is a multiple of 2 (for 16-bit)
        {
            Debug.LogError("Audio data size is not a multiple of 2 (likely 16-bit).");
            return null;
        }

        float[] audioData = new float[dataSize / 2];
        for (int i = 0; i < dataSize; i += 2)
        {
            audioData[i / 2] = BitConverter.ToSingle(wavData, i+headerSize);
        }

        AudioClip audioClip = AudioClip.Create("WAVClip", audioData.Length, 1, 16000, false);
        audioClip.SetData(audioData, 0);
        audioClip = Resample(audioClip, 16000, 44100);
        return audioClip;
        // float[] audioData = ByteArrayToFloatArray(wavData);
        // AudioClip audioClip = AudioClip.Create("WAVClip", audioData.Length, 1, 16000, false);
        // audioClip.SetData(audioData, 0);
        // audioClip = Resample(audioClip, 16000, 44100);
        // return audioClip;
    }

    private float[] ByteArrayToFloatArray(byte[] byteArray)
    {
        if (byteArray.Length % 4 != 0)
        {
            throw new ArgumentException("Byte array length must be a multiple of 4");
        }

        float[] floatArray = new float[byteArray.Length / 4];
        for (int i = 0; i < byteArray.Length; i += 4)
        {
            floatArray[i / 4] = BitConverter.ToSingle(byteArray, i);
        }

        return floatArray;
    }

    public AudioClip Resample(AudioClip originalClip, int oldFrequency, int newFrequency)
    {
        float[] data = new float[originalClip.samples * originalClip.channels];
        originalClip.GetData(data, 0);

        int newSampleCount = Mathf.RoundToInt(data.Length * ((float)newFrequency / oldFrequency));
        float[] newData = new float[newSampleCount];

        for (int i = 0; i < newSampleCount; i++)
        {
            float sampleIndex = (float)i / newSampleCount * data.Length;
            int sampleIndexInt = Mathf.FloorToInt(sampleIndex);
            float sampleIndexFraction = sampleIndex - sampleIndexInt;

            float sample1 = data[sampleIndexInt];
            float sample2 = data[Mathf.Min(sampleIndexInt + 1, data.Length - 1)];

            newData[i] = Mathf.Lerp(sample1, sample2, sampleIndexFraction);
        }

        AudioClip newClip = AudioClip.Create("ResampledClip", newSampleCount, originalClip.channels, newFrequency, false);
        newClip.SetData(newData, 0);
        return newClip;
    }
}